@Dailymirror_SL mothers with infants stood for hrs today @ Tamil Virutcham office in Vavuniya for some relief due to economic crisis. Surely with lots of love in their hearts for the #SLPP.
Eventually, seeing these images on FB, a wellwisher in the area had donated pongal treats. 
